function doAction() {
    var m = this.get("d3Wrapper")
    if (m.isMaxed) {
        //m.setExtent(pt(500,500))
        m.setExtent(m.originalExtent)
        this.label.textString = 'maximize'
    } else {
        this.label.textString = 'unmaximize'
        m.originalExtent = m.getExtent()
        m.setExtent(pt(3000,3000))
    }
    m.update()
    m.isMaxed = !m.isMaxed
}

