function fetchData() {
    var webR = this.dataURL.asWebResource()
    var xml = webR.get().content
    var xmlDoc = $.parseXML(xml)
    var $xml = $(xmlDoc)
    this.logEntries = [];

    var self = this;
    $A($xml.find("log").children().each(function() {
        var path = $($(this).find("path")).text();
        if (path.match(/./)) {
            var entry = {}
            entry.path = path;
            entry.author = $($(this).find("author")).text();
            entry.date = $($(this).find("date")).text();
            self.logEntries.push(entry)
        }
    }))

}

